import './App.css';
import React, {useEffect, useState} from 'react'

const App = () => {
    useEffect(() => {
        fetch("http://localhost:5001/test", {
            cors: "*"
        })
        .then(response => console.log(response.body))
        .catch(err => {
            console.log(err)
        })
    }, [])

    return (
        <div>
            This is testing the server communication:
        </div>
    )

}

export default App;
